import React from 'react';
import '../Team.css';
import aryanaImage from '../images/aryana.jpg';
import induImage from '../images/indu.pdf';

const teamMembers = [
  {
    name: "Aryana Far",
    role: "PM",
    image: aryanaImage, // Replace with a real image URL or path
  },
  {
    name: "Indu Abhilash",
    role: "Developer",
    image: induImage, // Replace with a real image URL or path
  },
];

function Team() {
  return (
    <div className="team-page">
      <h1>Meet the Team</h1>
      <div className="team-members">
        {teamMembers.map((member, index) => (
          <div className="team-member" key={index}>
            <img src={member.image} alt={`${member.name}'s profile`} className="team-image" />
            <h2>{member.name}</h2>
            <h3>{member.role}</h3>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Team;
